webpackJsonp([264],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-searching-for-existing-issues.json":function(e,s){e.exports={data:{markdownRemark:{html:'<p>If you still see problems after <a href="http://forum.freecodecamp.com/t/how-to-get-help-on-gitter/19130">Getting Help on Gitter</a>, you will want to try to see if anyone else has posted about a similar problem.</p>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/3/3577718dd9fe14fbe80b203bc3cc56cdb0d9c3af.gif" alt="gif walking through the subsequent steps to search GitHub for the issue"></p>\n<ol>\n<li>\n<p>Go to FreeCodeCamp\'s <a href="https://github.com/FreeCodeCamp/FreeCodeCamp/issues">Github Issues</a> page.</p>\n</li>\n<li>\n<p>Use the search bar to search for already filed issues that may be related to your problem.</p>\n<ul>\n<li>\n<p>If you find one, read it! You can subscribe to get updates about that specific issue by clicking on <code>Subscribe</code> in the sidebar. You can also comment on the issue if you have something to add.</p>\n</li>\n<li>\n<p>If you cannot find any relevant issues you should <a href="http://forum.freecodecamp.com/t/creating-a-new-github-issue/18392">Create a New Github Issue</a>.</p>\n</li>\n</ul>\n</li>\n</ol>',frontmatter:{title:"Searching for Existing Issues",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/searching-for-existing-issues/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/searching-for-existing-issues/"}}}});
